import React,{useState} from "react";


const Signup = () => {
    const [name,setname]=useState("");
    const[email,setemail]=useState("");
    const [password,setpassword]=useState("")
    const handleSubmit=(e)=>{
       e.preventDefault();
       console.log(name,email,password)
    }

     const handleChange=(e)=>{
         console.log(e)
     }

  return (
    <div>
      <div className="row">
        <form className="col s12 " onSubmit={handleSubmit}  >
          <div className="row s12 m12"></div>
          <div className="row">
            <div className="input-field col s12">
              <input id="name" type="text" className="validate" value={name} onChange={(e)=>handleChange(e)} />
              <label htmlFor="name">Name</label>
            </div>
          </div>
          <div className="row">
            <div className="input-field col s12">
              <input id="email" type="email" className="validate" value={email} onChange={(e)=>handleChange(e)}/>
              <label htmlFor="email">Email</label>
            </div>
          </div>
          <div className="row">
            <div className="input-field col s12">
              <input id="password" type="password" className="validate" value={password} onChange={(e)=>handleChange(e)}/>
              <label htmlFor="password">Password</label>
            </div>
          </div>
          <a className="waves-effect waves-light btn">Signup</a>
        </form>
      </div>
    </div>
  );
};

export default Signup;
